import httpClient from "../http-common2";
import httpClient1 from "../http-common3";
let emailId = localStorage.getItem("jwt");

const create = (data) => {
    return httpClient.post("/security/user/b/i", data);
  };

  const getAll = () => {
    return httpClient.get("/security/admin/t");
  };
  const remove = (id) => {
    return httpClient.delete(`/security/user/delete/booking/${id}`);
  };
  const update = (data) => {
    return httpClient.put("/security/user/updateBooking", data );
  };

  const get = (id) => {
    return httpClient1.get(`/bookingdetails/ga/${id}`);
  };
  const createTicket = (data) => {
    return httpClient1.post("/ticket/i", data);
  };
  const fullticket=(emailId)=>{
    return httpClient1.get(`/ga/fullBookingDetails/${emailId}`);
  }

  export default {create,getAll,remove,update,get,createTicket,fullticket};
